import React from "react";

const ChartBar = () => {
    return (
        <div>
            <div className="chart-bar">
                <div className="chart-bar__inner">
                    <div className="chart-bar__fill">

                    </div>
                </div> 
                <label className="chart-bar__label"></label>
            </div>
        </div>
    )
}

export default ChartBar;
